  "content": "<span class=\"hashtag\">#色色求轉</span> <span class=\"hashtag\">#色色徵友</span><br /><br class=\"double-br\" />嗨，這裡是絵夢，是一隻流浪兔子~<br />是可愛的偽娘，喜歡把西門風格的浮誇衣服穿到台北各地(？)<br />也喜歡明明很冷卻穿者可愛但薄薄的衣服在大風中當隻發抖的兔子(？？？)<br />喔對這隻兔子最近80年有點在發情狀態，夢想是幹人和被幹 <img class=\"emoticon_my\" src=\"https://emos.plurk.com/06314ca6792da8490efa03b0cdf59fc7_w20_h20.gif\" width=\"20\" height=\"20\"> <br /><br class=\"double-br\" />喔雖然是隻寵物兔子，但其實是SW，雖然當Top的經歷跟這隻兔子全身的脂肪一樣少，特別是胸部<br />喜歡聊天，喜歡肢體接觸牽手抱抱，喜歡吃好吃(甜)的東西<br />最近胃恢復了，回歸老本行當個吃貨兔子妖怪，前天吃著蜜糖吐司的樣貌被朋友給了&#34;好恐怖&#34;的結論 <img class=\"emoticon_my\" src=\"https://emos.plurk.com/3c9c183af28a38e21a7d53593d711682_w48_h48.jpeg\" width=\"48\" height=\"48\"> <br /><br class=\"double-br\" />以上，更多詳細請參考我的置頂噗，歡迎來找兔兔聊天撞進她溫暖的心窩 <img class=\"emoticon_my\" src=\"https://emos.plurk.com/281c1ab26b31a8840dec80b06443e3c4_w48_h48.gif\" width=\"48\" height=\"48\">",
